$(function(){$(".screenshotframe").dialog({autoOpen:!1,draggable:!1,resizable:!1,show:"clip",hide:"clip",speed:"fast",closeOnEscape:!0,width:790,height:"auto",title:"X"});$("#maincontent").accordion({heightStyle:"content",animate:"easeOutCubic"});$("#headercontent").click(function(){$("#maincontent").accordion("option","active",0)});$(".projtitle").click(function(){displayFull(this.id)})});$(document).ready(function(){drawSkills("skills");displayFull("sif")});
function showDialog(a){$("#"+a).dialog("open");$("#"+a).click(function(a){a.stopPropagation()})}function hideDialog(a){$("#"+a).dialog("close")}function displayFull(a){var d=$("#"+a+"txtfull").html();$("#projectdetails").html(d);$("h2.projtitle").removeClass("whiteonblue").addClass("blueonwhite");$("#"+a).addClass("whiteonblue");$("body").click(function(){hideDialog(a+"frame")});$("#"+a+"screen").click(function(b){b.stopPropagation();showDialog(a+"frame")})}
function drawSkills(a){for(var d="Java Ruby JavaScript PHP Lua C++ C# Perl MySQL MongoDB JSP jQuery GWT AWS Rails Apex CSS Tomcat".split(" "),b=[5,3,4,4,2,2,2,2,4,3,1,4,2,1,3,2,4,1],c="",e=0;e<d.length;e++)c+=drawSkill(d[e],b[e]);$("#"+a).html(c)}function drawSkill(a,d){for(var b='<div class="skill"><span class="skill_name">'+a+'</span><div class="skills_exp">',c=0;5>c;c++)b=d>c?b+'<div class="box filled"></div>':b+'<div class="box"></div>';return b+"</div></div>"};